 There are many common wild flowers on 
 the{Manxey Levels.}More of these since
 the drainage scheme has been          
 operating. The verges are covered with
{cow parsley.}The fields grow{Tansy,   
{Creeping Cinquefoil, Common}and{Meadow
{Vetch,}the{Marsh Pea,}and{White}and{  
{Red Clover, Buttercups}and{Daisies.}  
 These also grow along the higher{     
{Rockhouse Bank}- where{Deadly         
{Nightshade}can be found. The plants   
 which help give this area its         
 character are the{Common Bullrushes}  
 and{Yellow Iris}which border the      
 drainage ditches and streams as well  
 as the{Great Hairy Willowherb.}
